import "../styles/bee.css";

const Store = () => {
  return (
    <div className="container">
      <h2>Store</h2>
      <div className="two-columns">
        <div className="container">
          <h4>Honey</h4>
          <pre>Soome text...</pre>
        </div>
        <div className="container">
          <h4>Honey Products</h4>
